import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  useParams
} from "react-router-dom";
import { Home } from "./pages/rootPage"

function App() {
  return (
    <div className="App">
        <header>
          <Router>
            <Nav></Nav>
            <section className="">
              <Routes>
                <Route exact path='/' element={<Home /> }/>
              </Routes>
            </section>
            <Footer />
          </Router>
        </header>
      </div>
  );
}

export default App;
